import "./App.css";
// 헤더
import Header from "./Header";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <div id="wrapper">
        <Header />
        <div>
          <h1></h1>
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
